import {useState, useEffect} from "react";

function App() {

  const ID = 123;
  const [count, setCount] = useState(0);

  useEffect (() => {
    fetch('/count', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({"id": ID}),
    }).then(response => response.json()).then(response => setCount(Number(response)))
  }, [])

  const handleImageClick = () => {
    setCount(count + 1);
  };

  return (
      <div style={{textAlign: 'center', marginTop: '50px'}}>
        <h1>Счётчик: {count}</h1>

        <img
            src={`/images/homyak.png`}
            alt={"qq"}
            onClick={handleImageClick}
            style={{cursor: 'pointer', width: '150px', height: '150px', marginTop: '20px'}}
        />

      </div>
  );
  //tg.ready();
  // tg.expand();
}

export default App;
